import { Injectable } from '@angular/core';
import { ConnectionService } from '../firebase/connection.service';
import { BehaviorSubject } from 'rxjs';
import { IAccount } from '../../interfaces';
import { map } from 'rxjs/operators';

@Injectable({
  providedIn: 'root',
})
export class AccountService {
  private _repoData: BehaviorSubject<IAccount[]> = new BehaviorSubject<
    IAccount[]
  >([]);
  dataRepo$ = this._repoData.asObservable();

  constructor(private _firebase: ConnectionService) {}

  repoData(data: IAccount[]) {
    this._repoData.next(data);
  }

  filterDataFromQuery(select: string) {
    this._firebase.data
      .snapshotChanges()
      .pipe(
        map((changeData) =>
          changeData.map((c) => {
            let a = c.payload.doc.data();
            return {
              owner: a.owner,
              repo: a.repo,
              link: a.link,
              id: c.payload.doc.id,
            };
          })
        )
      )
      .subscribe((data) => {
        data.filter((e) => e.repo.toUpperCase().includes(select));
      });
  }
}

import { Injectable, NgZone } from '@angular/core';
import { AngularFireAuth } from '@angular/fire/compat/auth';
import { UserService } from '../user/user-service';
import { Router } from '@angular/router';
import { User } from '../../interfaces/user/user';
import { IAuthInfoUser } from '../../interfaces/auth/auth-info-user.types';
import { SpinnerStateService } from '../../../component/spinner/spinner-state.service';
import firebase from 'firebase/compat';
import { throwError } from 'rxjs';
import { ConnectionService } from '../firebase';
import FirebaseError = firebase.FirebaseError;

@Injectable({
  providedIn: 'root',
})
export class AuthService {
  user: User | any;

  constructor(
    private ngZone: NgZone,
    public afAuth: AngularFireAuth,
    private _router: Router,
    private _userService: UserService,
    private _sppinerService: SpinnerStateService,
    private _connectionService: ConnectionService
  ) {
    this.checkLocalStorage();
  }

  getDataFromFirebase() {
    this.afAuth.authState.subscribe((auth) => {
      if (auth) {
        this.user = auth;
        console.log('Authenticated');
        this._userService.setUserLoggedIn(auth);
      } else {
        this._sppinerService.setStateBehaviorSpinner(false);
        console.log('Not authenticated');
      }
    });
  }

  signInWithEmail(infoUser: IAuthInfoUser) {
    return this.afAuth
      .signInWithEmailAndPassword(infoUser.email, infoUser.password)
      .then((result) => {
        this._userService.setUserLoggedIn(result);
        this.ngZone.run(() => {
          this._router.navigate(['account']);
          this._sppinerService.setStateBehaviorSpinner(true);
        });
        return result;
      })
      .catch((err) => {
        this._router.navigate(['/auth/l']);
        this._sppinerService.setStateBehaviorSpinner(false);
        return throwError(err);
      });
  }

  signUp(infoUser: IAuthInfoUser) {
    return this.afAuth
      .createUserWithEmailAndPassword(infoUser.email, infoUser.password)
      .then((resp) => {
        this._sppinerService.setStateBehaviorSpinner(false);
      })
      .catch((error) => {
        console.error('error2');
        this._sppinerService.setStateBehaviorSpinner(false);
        // console.info(error.code)
        return 2;
      });
  }

  logout() {
    this._userService.clearLocalStorage();
    this.afAuth.signOut().then(() => {
      this._router.navigate(['/', 'auth/l']);
    });
  }

  forgotPassword(passwordResetEmail: string) {
    this._sppinerService.setStateBehaviorSpinner(true);
    return this.afAuth
      .sendPasswordResetEmail(passwordResetEmail)
      .then(() => {
        window.alert('Password reset email send, check your inbox!');
      })
      .catch((err) => {
        if (err.code === 'auth/user-not-found')
          window.alert('User Is not created');
        return err;
      })
      .finally(() => {
        this._sppinerService.setStateBehaviorSpinner(false);
      });
  }

  private checkLocalStorage() {
    if (!localStorage.getItem('user')) {
      this.getDataFromFirebase();
    } else {
      console.log('localStorage ready');
    }
  }

  private handleError(error: FirebaseError) {
    // Handle the HTTP error here
    console.log('handle Error');
    {
      if (error.name === 'FirebaseError') {
        console.log(error);
      }
    }
  }
}

import { Injectable } from '@angular/core';
