  forgotPassword(model: NgForm) {
    if (getVelocityEmail(model)) {
      this._sppinerService.setStateBehaviorSpinner(true);
      this._authService
        .forgotPassword(model.value.email)
        .then((resp) => {
          if (resp.code !== 'auth/user-not-found')
