  ngOnInit() {
    this.path = this.navigation();
  }

  navigation() {
    return this._router.events
      .pipe(filter((resp) => resp instanceof NavigationEnd))
      .subscribe((url: any) => {
        return (this.path = url.url.split('/').indexOf('new') == -1);
      });
